import React from 'react'
import { View, Text } from 'react-native';

class End extends React.Component{

    render(){
        return (
            <View >  
            <Text >Welcome to React Native!</Text>  
            <Text >To get started, edit App.js</Text>  
            <Text >ASAS</Text>  
          </View>  
        );
    }
}

export default End;
